import { Component } from "react";
import Mainpage from './Mainpage';


const Name="Arun";

var Myfun=()=>{
  console.log(" 1");
  return(<Mainpage/>)
 
}

class Home extends Component{

    render(){
      const Name=this.name;
        return(
          <div className="Home">
            <header id='header'>
              <label id='matrimony'>Matrimony</label>
              <span id='login'>
                <h6>you are already a member?<a href='login'><button id="b1">login</button></a>
                </h6>
              </span>

            </header>

            <h1 classNmae='c1'><i>Your search for the perfect match ends here!</i></h1>
            <form>
              <h2 id="heading"><b>Matrimony  Profile  for</b></h2>
              <select className="menu">
                <option>Myself</option>
                <option>Daughter</option>
                <option>Brother</option>
                <option>Son</option>
                <option>Sister</option>
                <option>Friend</option>
                <option>Relative</option>
              </select>
              <br></br>
              <br></br>
              <label><b>Name </b></label><br />
              <br />
              <input className="menu" type='text' placeholder='Name'></input>
              <br></br>
              <br></br>

              <label><b>Mobile No.</b></label><br />
              <br />
              <input className="menu" type='number' placeholder='Enter Number' />
              <br></br>
              <br /><br />
              <input className="reg" onClick={Myfun} type="button" value="register" />
              <h1>{Name}</h1>

            </form>


          </div>
 
    
  
        );
    }
}

export default Home;
